<span class="line"><span style="color:#E1E4E8;">  </span><span style="color:#79B8FF;">&quot;typ&quot;</span><span style="color:#E1E4E8;">: </span><span style="color:#9ECBFF;">&quot;JWT&quot;</span></span>
